	function petCursor_getDirection(numX, numY){
		//
		//set diagonals first (based on previous direction)
		if(numX > num_petCursor_prevX && str_petCursor_direction == "UP"){
			//UP DIAGONAL RIGHT
			arr_petCursorCurrentState = arr_petCursor_up_right;
